import Grid from './grid'

function Maze() {
    no_rows=new Array(10)
    no_columns=new Array(10)
    grid=<Grid height="10px" width="10px" />
    return (
        <div className="maze">
           {no_rows.forEach(()=>{
                    no_columns.forEach(()=>{
                        return grid
                    })
                })
            }
        </div>
    );
};

export default Maze;
